import React from 'react'

export const Nav = () => {
  return (
    <Navbar class="bg-black border-gray-200">
  <div class="max-w-screen-xl flex flex-wrap items-center justify-between mx-auto p-4">
    <a href="https://flowbite.com/" class="flex items-start">
        <img src="https://flowbite.com/docs/images/logo.svg" class="h-8 justify-start mr-5" alt="Flowbite Logo" />
        <span class="self-center text-xl whitespace-nowrap dark:text-white">Flowbite</span>
    </a>
    </div>
  </Navbar>
  )
}
export default Nav;
